import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const RegisterPage = () => {
  const [role, setRole] = useState('');
  const [formData, setFormData] = useState({
    id: '',
    name: '',
    email: '',
    password: ''
  });

  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    if (!role) {
      alert('❗ กรุณาเลือกประเภทผู้ใช้ก่อน');
      return;
    }

    console.log("📦 ส่งข้อมูล:", { ...formData, role });

    try {
      const response = await axios.post('http://localhost:5000/api/auth/register', {
        ...formData,
        role
      });
      alert('✅ สมัครสมาชิกสำเร็จ');
      navigate('/login'); // ✅ เปลี่ยนไปหน้า Login หลังสมัครเสร็จ
    } catch (err) {
      console.error('❌ สมัครไม่สำเร็จ:', err);
      alert('เกิดข้อผิดพลาดในการสมัคร');
    }
  };

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-purple-400 to-indigo-600 p-6">
      <div className="bg-white p-6 rounded-lg shadow-lg w-full max-w-md">
        <h2 className="text-2xl font-bold text-center text-indigo-700 mb-4">สมัครสมาชิก</h2>

        <form onSubmit={handleSubmit} className="space-y-4">

          <div>
            <label className="block text-sm font-medium text-gray-700">เลือกประเภทผู้ใช้</label>
            <select
              value={role}
              onChange={(e) => setRole(e.target.value)}
              className="input w-full border rounded px-3 py-2"
              required
            >
              <option value="">-- กรุณาเลือก --</option>
              <option value="student">นิสิต</option>
              <option value="company">สถานประกอบการ</option>
            </select>
          </div>

          {role && (
            <>
              <div>
                <label className="block text-sm font-medium text-gray-700">
                  {role === 'student' ? 'รหัสนิสิต' : 'เลขทะเบียนนิติบุคคล'}
                </label>
                <input
                  type="text"
                  name="id"
                  value={formData.id}
                  onChange={handleChange}
                  className="input w-full border rounded px-3 py-2"
                  required
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700">ชื่อ</label>
                <input
                  type="text"
                  name="name"
                  value={formData.name}
                  onChange={handleChange}
                  className="input w-full border rounded px-3 py-2"
                  required
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700">อีเมล</label>
                <input
                  type="email"
                  name="email"
                  value={formData.email}
                  onChange={handleChange}
                  className="input w-full border rounded px-3 py-2"
                  required
                />
              </div>

              <div>
                <label className="block text-sm font-medium text-gray-700">รหัสผ่าน</label>
                <input
                  type="password"
                  name="password"
                  value={formData.password}
                  onChange={handleChange}
                  className="input w-full border rounded px-3 py-2"
                  required
                />
              </div>
            </>
          )}

          <button
            type="submit"
            className="w-full bg-indigo-600 text-white py-2 rounded hover:bg-indigo-700"
          >
            สมัครสมาชิก
          </button>
        </form>
      </div>
    </div>
  );
};

export default RegisterPage;
